$(document).ready(function() {
  $('#user_avatar').bind('change', function() {
    var size_in_megabytes = this.files[0].size/1024/1024;
    if (size_in_megabytes > 5) {
      alert("image qua lon");
      $('#user_avatar').val("");
    }
  });

  $("#user_avatar").change(function(){
    $('#img_prev').removeClass('hidden');
    readURL(this);
    $('#img_prev').addClass('width-250 height-250');
  });
});

function readURL(input) {
  if (input.files && input.files[0]) {
    var reader = new FileReader();
    reader.onload = function (e) {
      $('#img_prev').attr('src', e.target.result);
    }
    reader.readAsDataURL(input.files[0]);
  }
}
;
$(document).ready(function() {
  $('.datepicker').datepicker({
    format: 'dd-mm-yyyy'
  });
});

$(document).ready(function() {
  // category course
  $('#category-id-post').on('change', function(e) {
    $.ajax({
      type: 'GET',
      url: '/admins/categories/' + this.value,
      data: {id: this.value, name: "Post"},
      success: function(data) {
        $('#types').html(data);
      },
      error: function(){
        alert("error");
      }
    })
  });

  // user seting
  $('#member_notification_setting').on('change', function(e) {
    $.ajax({
      dataType: 'json',
      url: location.pathname,
      method: 'get',
      data: {notify_setting: this.checked},
      success: function(data) {

      }
    })
  });

  $('#member_email_setting').on('change', function(e) {
    $.ajax({
      dataType: 'json',
      url: location.pathname,
      method: 'get',
      data: {email_setting: this.checked},
      success: function(data) {
      }
    })
  });
});



